import React from "react";
import styled from "styled-components";

const Container = styled.ul``;
const P = styled.p`
    font-size: 27px;
`;
export default function List({ children, day }) {
    return (
        <Container>
            <p>{day}</p>
            {children}
        </Container>
    );
}
